import React from 'react';

const style = `
.btn-portfolio {
  width: 100px;
  border: 1px solid white;
  border-radius: px;
  color: white;
}
`;

const Buttons = () => {
  return (
    <div className="btn-portfolio">
      <div>C</div>
      <div>Facebook</div>
      <style>{style}</style>
    </div>
  );
};

export default Buttons;
